import React from 'react'
import { Pagination } from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'

const Paginate = ({ pages, page, isAdmin = false, keyword = '', details }) => {
    console.log(detpageails);
    return pages > 1 && (
        <Pagination className='pagination'>
            {[...Array(pages).keys()].map(x => (
                <LinkContainer key={x + 1}
                    to={!isAdmin
                        ? keyword
                            ? `/search/${keyword}/page/${x + 1}`
                            : `/page/${x + 1}`
                        : isAdmin === true
                            ? details === 'productlist' ? `/admin/productlist/${x + 1}`
                                : details === 'orderlist' ? `/admin/orderlist/${x + 1}`
                                    : ({})
                            : (details === 'Nike' || details === 'Converse') ? `/brand/${details}/${x + 1}`
                                : ({})
                    }>
                    <Pagination.Item active={x + 1 === page}> {x + 1}</Pagination.Item>
                </LinkContainer>
            ))}
        </Pagination>
    )
}

export default Paginate
